import React from "react";
import { Link, withRouter } from "react-router-dom";
import facebookLogo from "./../images/facebook.png";
import facebookIcons from "./../images/facebookIcons.png"

const styles = {
  barStyles:{
    display: "flex",
    alignItems: "left",
    height: "60px",
    backgroundColor: "white",
    boxShadow: "0px 1px 4px #c5c5c5",
    padding: "10px 10px 10px 10px"
  },
  buttonIconStyles: {
    margin: "10px",
    alignSelf: "right",
    background: "grey",
    borderRadius: "50%",
  }
};

function buttonIcon(props) {
  return (
    <img scr = {props.scr} style = {styles.imageStyles}></img>
  )
}

function TopBar(props) {
  return (
    <div className="navigation">
      <nav style = {styles.barStyles}>
        <img src = {facebookLogo} width = "40" height = "40"></img>
        <Link class="navbar-brand" to="/">
          Facebook Lite
        </Link>
        <img src = {facebookIcons} ></img>
        <div>
          <ul class="navbar-nav ml-auto">
            <li
              class={`nav-item  ${
                props.location.pathname === "/pages/Home" ? "active" : ""
              }`}
            >
              <Link class="nav-link" to="/pages/Home">
                Home
                <span class="sr-only">(current)</span>
              </Link>
            </li>
          </ul>
        </div>
      </nav>
    </div>
  );
}

export default withRouter(TopBar);
